import React, { Component } from "react";
// import { Link } from "react-router-dom";
import axios from "axios";

class usdrate extends Component {
  constructor(props) {
    super(props);
    this.state = {
      Date: "",
      Bank: "",
      Timestamp: "",
      rates: new Object(),
    };
  }

  componentDidMount() {
    axios
      .get("http://localhost:5000/currencies/USD")
      .then((response) => {
        this.setState({
          Date: response.data.Date,
          Bank: response.data.Bank,
          Timestamp: response.data.Timestamp,
          rates: new Object(response.data.rates),
        });
      })
      .catch((error) => {
        console.log(error);
      });
  }

  render() {
    return (
      <div>
        <h3>USD Rates</h3>
        <select type="text" Date={this.state.Date} Bank={this.state.Bank} />
      </div>
    );
  }
}

export default usdrate;
